    fn __expected_tokens(__state: usize) -> Vec<::std::string::String> {
        const __TERMINAL: &'static [&'static str] = &[
            r###""(""###,
            r###"")""###,
            r###""*""###,
            r###""+""###,
            r###"",""###,
            r###""-""###,
            r###""->""###,
            r###"".""###,
            r###""/""###,
            r###"":""###,
            r###"":=""###,
            r###"";""###,
            r###""<""###,
            r###""<=""###,
            r###""<>""###,
            r###""=""###,
            r###"">""###,
            r###"">=""###,
            r###""[""###,
            r###""]""###,
            r###""and""###,
            r###""array""###,
            r###""break""###,
            r###""do""###,
            r###""else""###,
            r###""end""###,
            r###""for""###,
            r###""function""###,
            r###""if""###,
            r###""in""###,
            r###""let""###,
            r###""of""###,
            r###""or""###,
            r###""then""###,
            r###""to""###,
            r###""type""###,
            r###""var""###,
            r###""while""###,
            r###""{""###,
            r###""}""###,
            r###"r#"\"[^\"]*\""#"###,
            r###"r#"[0-9]+"#"###,
            r###"r#"[a-zA-Z]*"#"###,
        ];
        __ACTION[(__state * 43)..].iter().zip(__TERMINAL).filter_map(|(&state, terminal)| {
            if state == 0 {
                None
            } else {
                Some(terminal.to_string())
            }
        }).collect()
    }
